import{_ as e,o as a,c as t,Q as r}from"./chunks/framework.d29bb331.js";const i="/better-on-bedrock-wiki/assets/willager.3ec13870.png",o="/better-on-bedrock-wiki/assets/enchanter.47ed5e11.png",s="/better-on-bedrock-wiki/assets/flender.73b402c1.png",n="/better-on-bedrock-wiki/assets/inferior.eb3eedb2.png",l="/better-on-bedrock-wiki/assets/withered_samurai.4a4e92cc.png",d="/better-on-bedrock-wiki/assets/raccoon.7e0fe3c0.png",h="/better-on-bedrock-wiki/assets/deer.a6406288.png",c="/better-on-bedrock-wiki/assets/toucan.c321351a.png",b="/better-on-bedrock-wiki/assets/squirrel.430be787.png",m="/better-on-bedrock-wiki/assets/goblin_trader.63e241da.png",p="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAABGdBTUEAALGPC/xhBQAAAAFzUkdCAK7OHOkAAABtSURBVDjLrZNREkARCEXbhj9j/3vMj97UleTRTD/qHhchZqabDIulNh4ZA3QoETsg02wceA2lti9xA+NAbGZDNBMgC/EARy70xb4B6MXfAClkxNMzPgXsjrEDhBCsrQDmD8B4UwjA8UXhEnCTHXbKIdbBEGAIAAAAAElFTkSuQmCC",f="/better-on-bedrock-wiki/assets/trade-table-1.c735af95.png",u="/better-on-bedrock-wiki/assets/trade-table-2.f4878f94.png",g="/better-on-bedrock-wiki/assets/trade-table-3.266b0f68.png",k="/better-on-bedrock-wiki/assets/corrupted_villager.b4c39a13.png",q="/better-on-bedrock-wiki/assets/lonely_wizard.4c4f05ae.png",w="/better-on-bedrock-wiki/assets/sparrow.a5260fc4.png",x="/better-on-bedrock-wiki/assets/quetzacaw.77f81395.png",y="/better-on-bedrock-wiki/assets/hell_hound.06bf006b.png",T="/better-on-bedrock-wiki/assets/fire_wisp.b4aef332.png",z=JSON.parse('{"title":"Better on Bedrock","description":"","frontmatter":{},"headers":[],"relativePath":"mobs.md","filePath":"mobs.md"}'),_={name:"mobs.md"},I=r('<h1 id="better-on-bedrock" tabindex="-1">Better on Bedrock <a class="header-anchor" href="#better-on-bedrock" aria-label="Permalink to &quot;Better on Bedrock&quot;">​</a></h1><h2 id="mob-wiki" tabindex="-1">Mob Wiki <a class="header-anchor" href="#mob-wiki" aria-label="Permalink to &quot;Mob Wiki&quot;">​</a></h2><p>Need help with how to find mobs or what they do? This wiki has your back. Select the topic you want from the sidebar or search the block name!</p><h2 id="bosses" tabindex="-1">Bosses <a class="header-anchor" href="#bosses" aria-label="Permalink to &quot;Bosses&quot;">​</a></h2><h2 id="willager" tabindex="-1">Willager <a class="header-anchor" href="#willager" aria-label="Permalink to &quot;Willager&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+i+'" alt="Example Image" width="64"></div><h3 id="info" tabindex="-1">Info <a class="header-anchor" href="#info" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Willager is part of the Illager Family. He is the ruler amongs them.</p><h3 id="location" tabindex="-1">Location <a class="header-anchor" href="#location" aria-label="Permalink to &quot;Location&quot;">​</a></h3><p>The Willager is found at a ruined structures. The structure contains pillars and one chest in the centre. Open the chest to summon the Willager.</p><h2 id="enchantaegis" tabindex="-1">Enchantaegis <a class="header-anchor" href="#enchantaegis" aria-label="Permalink to &quot;Enchantaegis&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+o+'" alt="Example Image" width="64"></div><h3 id="info-1" tabindex="-1">Info <a class="header-anchor" href="#info-1" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Enchantaegis is part of the Illager Family. He is the one that gave them power.</p><h3 id="location-1" tabindex="-1">Location <a class="header-anchor" href="#location-1" aria-label="Permalink to &quot;Location&quot;">​</a></h3><p>The Enchantaegis is found at a ruined pyramid. The structure contains a secret room and kidnapped villager that were tested on by the Enchantaegis.</p><h2 id="flender" tabindex="-1">Flender <a class="header-anchor" href="#flender" aria-label="Permalink to &quot;Flender&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+s+'" alt="Example Image" width="129"></div><h3 id="info-2" tabindex="-1">Info <a class="header-anchor" href="#info-2" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Flender is the Leader of the Phantoms.</p><h3 id="location-2" tabindex="-1">Location <a class="header-anchor" href="#location-2" aria-label="Permalink to &quot;Location&quot;">​</a></h3><p>The Flender is located on top of a quarts tower. To summon the Flender, simply walk near this tower and it will spawn.</p><h2 id="shielded-pyroclast" tabindex="-1">Shielded Pyroclast <a class="header-anchor" href="#shielded-pyroclast" aria-label="Permalink to &quot;Shielded Pyroclast&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+n+'" alt="Example Image" width="64"></div><h3 id="info-3" tabindex="-1">Info <a class="header-anchor" href="#info-3" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Shielded Pyroclast is the King of the Nether.</p><h3 id="location-3" tabindex="-1">Location <a class="header-anchor" href="#location-3" aria-label="Permalink to &quot;Location&quot;">​</a></h3><p>The Shielded Pyroclast is located in a battle arena found in the Nether.</p><h2 id="withered-samurai" tabindex="-1">Withered Samurai <a class="header-anchor" href="#withered-samurai" aria-label="Permalink to &quot;Withered Samurai&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+l+'" alt="Example Image" width="64"></div><h3 id="info-4" tabindex="-1">Info <a class="header-anchor" href="#info-4" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Withered Samurai is the Wither Keeper</p><h3 id="location-4" tabindex="-1">Location <a class="header-anchor" href="#location-4" aria-label="Permalink to &quot;Location&quot;">​</a></h3><p>The Withered Samurai is located inside a Blacstone Caslte found in the Nether.</p><h3 id="boss-stats" tabindex="-1">Boss Stats <a class="header-anchor" href="#boss-stats" aria-label="Permalink to &quot;Boss Stats&quot;">​</a></h3><table><thead><tr><th><strong>Boss</strong></th><th><strong>Health</strong></th><th><strong>Attack Num</strong></th><th><strong>Drops</strong></th></tr></thead><tbody><tr><td><strong>Willager</strong></td><td>250</td><td>4</td><td>- Willager Hat</td></tr><tr><td><strong>Enchantaegis</strong></td><td>350</td><td>3</td><td>- Enchantaegis Eye</td></tr><tr><td><strong>Flender</strong></td><td>350</td><td>4</td><td>- Ghost Necklace</td></tr><tr><td><strong>Shielded Pyroclast</strong></td><td>350</td><td>5</td><td>- Blade of the Nether</td></tr><tr><td><strong>Withered Samurai</strong></td><td>365</td><td>4</td><td>- Empty Amulet</td></tr></tbody></table><h2 id="none-boss-mobs" tabindex="-1">None Boss Mobs <a class="header-anchor" href="#none-boss-mobs" aria-label="Permalink to &quot;None Boss Mobs&quot;">​</a></h2><h2 id="racoon" tabindex="-1">Racoon <a class="header-anchor" href="#racoon" aria-label="Permalink to &quot;Racoon&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+d+'" alt="Example Image" width="129"></div><h3 id="info-5" tabindex="-1">Info <a class="header-anchor" href="#info-5" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Racoon is a passive mob found in the overworld. This mob is really friendly and will take any gifts you give it.</p><h3 id="what-it-does" tabindex="-1">What It Does <a class="header-anchor" href="#what-it-does" aria-label="Permalink to &quot;What It Does&quot;">​</a></h3><p>The Racoon can not be tamed. The Racoon can dig up treasure for you at random times. The items are shown in the table below with the chance it has to spawn.</p><h3 id="breedable" tabindex="-1">Breedable <a class="header-anchor" href="#breedable" aria-label="Permalink to &quot;Breedable&quot;">​</a></h3><p>This Mob can be bred with any food item</p><h2 id="deers-does" tabindex="-1">Deers &amp; Does <a class="header-anchor" href="#deers-does" aria-label="Permalink to &quot;Deers &amp; Does&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+h+'" alt="Example Image" width="129"></div><h3 id="info-6" tabindex="-1">Info <a class="header-anchor" href="#info-6" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The deer is a passive mob. The deer has a change to spawn with an ehcnated variant. The enchanted variant gives the mob more health and better loot drops</p><h3 id="drops" tabindex="-1">Drops <a class="header-anchor" href="#drops" aria-label="Permalink to &quot;Drops&quot;">​</a></h3><table><thead><tr><th><strong>Drop</strong></th><th><strong>%</strong></th><th><strong>Enchanted Drop</strong></th><th><strong>Enchanted %</strong></th></tr></thead><tbody><tr><td><strong>Deer Hide</strong></td><td>35</td><td>Gold &amp; Iron Ingots</td><td>80</td></tr></tbody></table><h3 id="breedable-1" tabindex="-1">Breedable <a class="header-anchor" href="#breedable-1" aria-label="Permalink to &quot;Breedable&quot;">​</a></h3><p>This Mob can be bred with wheat</p><h2 id="toucan" tabindex="-1">Toucan <a class="header-anchor" href="#toucan" aria-label="Permalink to &quot;Toucan&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+c+'" alt="Example Image" width="129"></div><h3 id="info-7" tabindex="-1">Info <a class="header-anchor" href="#info-7" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Toucan is a passive mob. It is part of the bird family. It spawns anywhere in the Overworld. The Toucan can not be tamed.</p><h2 id="squirrel" tabindex="-1">Squirrel <a class="header-anchor" href="#squirrel" aria-label="Permalink to &quot;Squirrel&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+b+'" alt="Example Image" width="129"></div><h3 id="info-8" tabindex="-1">Info <a class="header-anchor" href="#info-8" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The squirrel is a passive mob. It is found anywhere in the Overworld. The Squirrel can not be tamed</p><h2 id="goblin-trader" tabindex="-1">Goblin Trader <a class="header-anchor" href="#goblin-trader" aria-label="Permalink to &quot;Goblin Trader&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+m+'" alt="Example Image" width="129"></div><h3 id="info-9" tabindex="-1">Info <a class="header-anchor" href="#info-9" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Goblin Trader is a Passive Mob. This mob has a rare chance to spawn. This little guy can be traded with, and he has the best trades.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This mob has a 10% to spawn.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p><img src="'+p+'" alt="Example Image" width="64"> This icon refers to a custom item.</p></div><h3 id="trades" tabindex="-1">Trades <a class="header-anchor" href="#trades" aria-label="Permalink to &quot;Trades&quot;">​</a></h3><div style="display:flex;align-items:center;"><img src="'+f+'" alt="Example Image" width="129"></div><div style="display:flex;align-items:center;"><img src="'+u+'" alt="Example Image" width="129"></div><div style="display:flex;align-items:center;"><img src="'+g+'" alt="Example Image" width="129"></div><h2 id="corrupted-villager" tabindex="-1">Corrupted Villager <a class="header-anchor" href="#corrupted-villager" aria-label="Permalink to &quot;Corrupted Villager&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+k+'" alt="Example Image" width="64"></div><h3 id="info-10" tabindex="-1">Info <a class="header-anchor" href="#info-10" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Corrupted Villager is a Villager Type that is full of anger. This Mob can be cured with a Golden Apple. Once Cured, he has a trade table</p><h3 id="trades-1" tabindex="-1">Trades <a class="header-anchor" href="#trades-1" aria-label="Permalink to &quot;Trades&quot;">​</a></h3><p>He trades Magic Scrolls and Inactive Runes for Activated Runes.</p><h3 id="where-to-find" tabindex="-1">Where to find <a class="header-anchor" href="#where-to-find" aria-label="Permalink to &quot;Where to find&quot;">​</a></h3><p>This mob is found within forest biomes inside a spruce house.</p><h2 id="lonely-wizard" tabindex="-1">Lonely Wizard <a class="header-anchor" href="#lonely-wizard" aria-label="Permalink to &quot;Lonely Wizard&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+q+'" alt="Example Image" width="64"></div><h3 id="info-11" tabindex="-1">Info <a class="header-anchor" href="#info-11" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Lonely Wizard is a Villager Wizard. He lives alone far from his kind.</p><h3 id="trades-2" tabindex="-1">Trades <a class="header-anchor" href="#trades-2" aria-label="Permalink to &quot;Trades&quot;">​</a></h3><p>He trades Activated Runes for Staffs</p><h3 id="where-to-find-1" tabindex="-1">Where to find <a class="header-anchor" href="#where-to-find-1" aria-label="Permalink to &quot;Where to find&quot;">​</a></h3><p>This mob is found within Taiga biomes inside a big house.</p><h2 id="sparrow" tabindex="-1">Sparrow <a class="header-anchor" href="#sparrow" aria-label="Permalink to &quot;Sparrow&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+w+'" alt="Example Image" width="64"></div><h3 id="info-12" tabindex="-1">Info <a class="header-anchor" href="#info-12" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Sparrow is a passive mob. It is part of the Bird Family. This Mob can not be tamed, but can be bred. This mob is found in the overworld.</p><h3 id="breedable-2" tabindex="-1">Breedable <a class="header-anchor" href="#breedable-2" aria-label="Permalink to &quot;Breedable&quot;">​</a></h3><p>This Mob can be bred with any seed</p><h2 id="quetzacaw" tabindex="-1">Quetzacaw <a class="header-anchor" href="#quetzacaw" aria-label="Permalink to &quot;Quetzacaw&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+x+'" alt="Example Image" width="129"></div><h3 id="info-13" tabindex="-1">Info <a class="header-anchor" href="#info-13" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Quetzacaw is a hostile mob, found in the Nether. It is a bird. This mob can be made friendly by placing and hatching a <code>Quetzacaw Egg</code>.</p><h3 id="drops-1" tabindex="-1">Drops <a class="header-anchor" href="#drops-1" aria-label="Permalink to &quot;Drops&quot;">​</a></h3><table><thead><tr><th><strong>Drop</strong></th><th><strong>%</strong></th></tr></thead><tbody><tr><td><strong>Quetzacaw Feather</strong></td><td>100</td></tr></tbody></table><h3 id="breedable-3" tabindex="-1">Breedable <a class="header-anchor" href="#breedable-3" aria-label="Permalink to &quot;Breedable&quot;">​</a></h3><p>This Mob can not breed.</p><h2 id="hellhound" tabindex="-1">Hellhound <a class="header-anchor" href="#hellhound" aria-label="Permalink to &quot;Hellhound&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+y+'" alt="Example Image" width="129"></div><h3 id="info-14" tabindex="-1">Info <a class="header-anchor" href="#info-14" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Hell Hound is a wolf in the Nether. It is big. When it attacks, its target is set on fire</p><h3 id="breedable-4" tabindex="-1">Breedable <a class="header-anchor" href="#breedable-4" aria-label="Permalink to &quot;Breedable&quot;">​</a></h3><p>This Mob can not breed.</p><h2 id="fire-wisps" tabindex="-1">Fire Wisps <a class="header-anchor" href="#fire-wisps" aria-label="Permalink to &quot;Fire Wisps&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+T+'" alt="Example Image" width="64"></div><h3 id="info-15" tabindex="-1">Info <a class="header-anchor" href="#info-15" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Fire Wisp acts as a Blaze, but weaker.</p>',111),v=[I];function P(A,E,B,S,W,D){return a(),t("div",null,v)}const C=e(_,[["render",P]]);export{z as __pageData,C as default};
